var entityCollection = Get<ICompositeObjectList<ICompositeObject>>("ReadDataUserTask.ResultCompositeObjectList");

foreach(var entity in entityCollection)
{
	if (entity.TryGetValue<Guid>("Id", out Guid visaId))
	{
		var visaSchema = UserConnection.EntitySchemaManager.GetInstanceByName("SrmArtifactVisa");
		var visa = visaSchema.CreateEntity(UserConnection);
		if(visa.FetchFromDB("Id", visaId))
		{
			visa.SetColumnValue("SetDate", DateTime.Now);
			visa.SetColumnValue("SrmVisaResultId", SrmApprovalServiceConstantsCS.SrmVisaResult.Canceled);
			visa.SetColumnValue("StatusId", SrmApprovalServiceConstantsCS.VisaStatus.Canceled);
			visa.Save();
		}
	}
}

return true;

var helper = ClassFactory.Get<SrmApprovalServiceHelper>(new ConstructorArgument("userConnection", UserConnection));
var artifactId = Get<Guid>("SrmArtifact");
var recordId = helper.GetArtifactApprovalObjectRecordId(artifactId);
Set("SrmRecordId", recordId);
return true;
